import React, { Fragment } from "react";

export function Matricula() {
  return (
    <Fragment>
      <div className="index">
        <section className="home-s1">
          <div className="header-sep"></div>
          <Slider 
            slides={slides}
            interval={8000}
            controls={true} 
            indicators={true}
          />
        </section>
        <section className="home-s2">
          <Content />
        </section>
      </div>
    </Fragment>
  );
}
